import { createWebHistory, createRouter } from "vue-router";

// 연결할 각 컴포넌트 import
import Content from '@/layouts/Content.vue';

const router = createRouter({
    history : createWebHistory(),
    routes,
})

const routes = [
    {
        path: "/test",
        component: Content,
    },
]

export {router};
